public int compareTo(ReservationInterval anotherInterval) {
  long diff = 0;
  if (startTime == anotherInterval.getStartTime()) {
    diff = endTime - anotherInterval.getEndTime();
  } else {
    diff = startTime - anotherInterval.getStartTime();
  }
  if (diff < 0) {
    return -1;
  } else if (diff > 0) {
    return 1;
  } else {
    return 0;
  }
}
